import React, { Component } from 'react';
export default class About extends Component {
  render() {
    let resumeData = this.props.resumeData;
    return (
      <section id="about">
      <div className="three columns">
      <img className="profile-pic"  src="images/zuckerberg.jpg" alt="" />

        <h3>Skills</h3>

           <p>JavaScript</p>
           <img id="tech-logo" src="images/javascript.png" alt="javascript.logo"/>
           <p>React</p>
           <p>Ruby</p>
           <p>Ruby on Rails</p>
           <p>SQL</p>
           <p>HTML5</p>
           <p>CSS</p>
           <p>Github</p>
           <p>AWS</p>


      </div>
          <div className="container">
             <h2>About Me</h2>
             <div className ="header-break"></div>
             <p className = "intro-p">{resumeData.aboutme}</p>
          </div>
      </section>
    );
  }
}
